window.bookSummaryJSON = "<p><b>Stuck in the game, a complete litRPG trilogy</b></p> <p>Hal can't catch a break.</p> <p>What can he do to turn his luck around?</p> <p>Wandering through a flea market, a strange woman starts to talk his ear off. She won’t let him leave. He doesn’t want any of her junk, that is, until she pulls out a bootleg copy of a new game. Maybe he can forget his troubles for a few hours?</p> <p>What happens next turns Hal’s life upside-down.</p> <p>You’ll love this epic litRPG fantasy series, because every game needs a winner.</p> <p>Play along with Hal as he becomes an <i>Accidental Thief</i>, <i>Warrior</i>, and <i>Mage</i>. It's three full-length audiobooks in one!</p> <p><b>Get it now!</b></p>"; 
